INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, 3000, 2, "調子が上がって\nきたなっ", "vo_minigame_1013_icon_1_002_001", 2, 1, 1000, "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_2_002_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, 3000, 2, "ほらほら、\nまだいけるだろ？", "vo_minigame_1013_icon_1_003_001", 2, 2, 5000, "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_2_003_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, 3000, 2, "へへっ、おまえら\nやるじゃねえか！", "vo_minigame_1013_icon_1_004_001", 3, 3, 10000, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_2_004_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, 3000, 3, "あたしたちはまだ\n止まらねえぜ！", "vo_minigame_1013_icon_1_005_001", 3, 4, 10000, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_2_005_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, 3000, 3, "見てろよ！\nマコト班の快進撃だ！", "vo_minigame_1013_icon_1_005_002", 3, 5, 10000, "まだまだ行きます\nついてきなさい", "vo_minigame_1013_icon_2_005_002");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, 3000, 3, "うおぉぉっ！\n絶好調だぜ！", "vo_minigame_1013_icon_1_005_003", 3, 6, 10000, "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_2_005_003");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, 3000, 4, "どこまで行けるか\n楽しみだなっ！", "vo_minigame_1013_icon_1_006_001", 3, 7, 0, "ここからは\n前人未到の領域です！", "vo_minigame_1013_icon_2_006_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, 1000, 5, "まだ諦めんなよっ", "vo_minigame_1013_icon_1_007_001", 4, 8, 1, "厄介でしたわ…", "vo_minigame_1013_icon_2_007_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, 1000, 5, "冷やっとしたぜ…！", "vo_minigame_1013_icon_1_007_002", 4, 9, 1, "油断大敵です", "vo_minigame_1013_icon_2_007_002");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, 1000, 5, "弱音を吐くなっ", "vo_minigame_1013_icon_1_007_003", 4, 10, 1, "忌々しいっ…", "vo_minigame_1013_icon_2_007_003");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (4, 1500, 6, "マコト班集合！", "vo_minigame_1013_icon_1_008_001", 3, 11, 99, "大所帯ですわね", "vo_minigame_1013_icon_2_008_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (4, 1500, 6, "連携してくぞ！", "vo_minigame_1013_icon_1_008_002", 3, 12, 99, "エリコ班へようこそ", "vo_minigame_1013_icon_2_008_002");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (1, 3000, 8, "みんなに力を！", "vo_minigame_1013_icon_1_020_001", 6, 13, 0, "ナナカちゃんに\nお任せあれ", "vo_minigame_1013_icon_2_020_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (1, 3000, 9, "任せてくれたまえ", "vo_minigame_1013_icon_1_022_001", 7, 14, 0, "はっはっは！\n任せろ！", "vo_minigame_1013_icon_2_022_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (1, 3000, 10, "ほな、いきまひょか", "vo_minigame_1013_icon_1_023_001", 8, 15, 0, "どんどんいくわよ", "vo_minigame_1013_icon_2_023_001");
